import React from "react";
import logo from "./logo.svg";
import "./App.css";
import RoomPicker from "./components/RoomPicker";
import { Router, Route, Switch } from "react-router";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" render={(props) => <RoomPicker />} />
      </Switch>
    </div>
  );
}

export default App;
